import { useState, useEffect } from "react"

const Home = () => {
    const [data, setData] = useState()

    useEffect(() => {

        const getData = async () => {
            try {
                const res = await fetch(`${process.env.REACT_APP_SERVERURL}/message`)
                const json = await res.json()
                setData(json)
            } catch (err) {
                console.log(err)
            }
        }

    }, [])

    return(
        <h1>Home Page</h1>
    )
}

export default Home
